// App.js
import React from 'react';
import { BrowserRouter as Router, Switch, Route } from 'react-router-dom';
import StudentLogin from './StudentLogin';
import RecruiterLogin from './RecruiterLogin';
import CoordinatorLogin from './CoordinatorLogin';
import StaffLogin from './StaffLogin';

function App() {
  return (
    <Router>
      <Switch>
        <Route path="/student" component={StudentLogin} />
        <Route path="/recruiter" component={RecruiterLogin} />
        <Route path="/coordinator" component={CoordinatorLogin} />
        <Route path="/staff" component={StaffLogin} />
      </Switch>
    </Router>
  );
}

export default App;
